import React from "react";

import HornedBeast from "./HornedBeast"



class Main extends React.Component{
    render(){
        return(
            
            <div className='main'>
                <HornedBeast
                title = "UniWha"
                imageUrl = "data:image/jpeg;base64, "
         description = 'AAAAA'
         
         />
                    <HornedBeast
                    title = "unicorn"
    imageUrl = ""
             description = 'hello this is a new unicorn photo'
            
             />
                    </div>
        )
    }
}

export default Main;
